But I couldn’t leave it there when the possibility of these extraordinary candles made in a color of my choosing became possible thanks to wonderful Paulina. The artisan had them ready in less than day!

For quite some time I have ogled @totemhome ‘s stunning pink ceramic dinner plates and this was the table to use them on. 

Assorted peperomias “potted” in mezcal gourd cups and local apricots finished the table. 

Deep thanks to my dearest @mcbuckley for racing me around the market and then with @maiden_flower_farm helping pull it all together. 

